import React, {Component} from 'react';
import './Nav.css';
class Category extends Component {
  render() {
    let onClickCategoryExtend = (e) => {
        document.getElementById('category-sub-id-1').style.display ='block'
        debugger;
      }
    var category = null;
    if(this.props.Category.subCategory!==undefined) {
      category = 
        <div className="Category">
          <div id="category-main-1" className="Category-main">
            <span>Category</span>
            <button className="Category-button extend" onClick={onClickCategoryExtend}>+</button>
          </div>
          <div id="Category-sub-1" className="Category-sub"> 
             <span>Category</span>
              <button id="category-sub-id-1" className="Category-button short" onClick="">-</button>
          </div>
         
        </div>
      
    }
    return(
      <li className="Nav-category-item">
        {category}
      </li>
    )
  }
}

export default class Nav extends Component {
    render() {
      let category = {
        subCategory: 'subCategory'
      };
      return(
        <div className="Nav">
          <div className="Nav-category-tab">category</div>
          <ul className="Nav-category-items">
              <Category Category={category}></Category>
          </ul>
          <p className="Nav-category-foot">foot</p>
        </div>
      )
    }
  }
